import React, {Component} from 'react';
import './Main.css'

class MainFullstack extends Component {

  render() { 
    return (
      <section>
        <h2 className="fullStack-content">FULL-STACK<span className="fullStack-content">DEV</span></h2>
        <p id="fullStack-content">講一些我會的東東。例如 react, redux等等之類的。啊希望將來可以用英文打比較潮。</p>
      </section>
    )
  }
}


export default MainFullstack
